import React, { useState } from "react";
import { Calendar, User, ArrowRight, Search, Tag } from "lucide-react";
import "./Blog.css";

const Blog = () => {
  const [selectedCategory, setSelectedCategory] = useState("all");
  const [searchTerm, setSearchTerm] = useState("");
  const [selectedPost, setSelectedPost] = useState(null);

  // Blog data (shortened)
  const blogPosts = [
    {
      id: 1,
      title: "Life Path Number Basics",
      excerpt: "Learn how your Life Path Number reveals your life's purpose.",
      content: "Full content about Life Path Number...",
      author: "Sarah Mitchell",
      date: "2025-08-05",
      readTime: "8 min read",
      category: "Life Path",
      image: "https://via.placeholder.com/300",
      tags: ["Life Path", "Numerology"],
    },
    {
      id: 2,
      title: "Master Numbers 11, 22, 33",
      excerpt: "Explore the power of Master Numbers in numerology.",
      content: "Full content about Master Numbers...",
      author: "David Chen",
      date: "2025-08-03",
      readTime: "10 min read",
      category: "Master Numbers",
      image: "https://via.placeholder.com/300",
      tags: ["Master Numbers", "Spiritual Growth"],
    },
  ];

  const categories = [
    { id: "all", name: "All" },
    { id: "Life Path", name: "Life Path" },
    { id: "Master Numbers", name: "Master Numbers" },
  ];

  // Filter posts by category and search
  const filteredPosts = blogPosts.filter((post) => {
    const matchesCategory =
      selectedCategory === "all" || post.category === selectedCategory;
    const matchesSearch =
      post.title.toLowerCase().includes(searchTerm.toLowerCase()) ||
      post.excerpt.toLowerCase().includes(searchTerm.toLowerCase());
    return matchesCategory && matchesSearch;
  });

  // Show full post if selected
  if (selectedPost) {
    return (
      <div className="blog-container">
        <button onClick={() => setSelectedPost(null)}>← Back</button>
        <h1>{selectedPost.title}</h1>
        <img src={selectedPost.image} alt={selectedPost.title} />
        <p>
          <Calendar size={14} /> {new Date(selectedPost.date).toLocaleDateString()} •{" "}
          {selectedPost.readTime}
        </p>
        <p>{selectedPost.content}</p>
        <div>
          {selectedPost.tags.map((tag) => (
            <span key={tag}>
              <Tag size={10} /> {tag}
            </span>
          ))}
        </div>
      </div>
    );
  }

  // Main blog list view
  return (
    <div className="blog-container">
      <h1>✨ NumPath Blog</h1>

      {/* Search */}
      <div className="search-bar">
        <Search size={16} />
        <input
          type="text"
          placeholder="Search articles..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
      </div>

      {/* Categories */}
      <div className="categories">
        {categories.map((cat) => (
          <button
            key={cat.id}
            onClick={() => setSelectedCategory(cat.id)}
            className={selectedCategory === cat.id ? "active" : ""}
          >
            {cat.name}
          </button>
        ))}
      </div>

      {/* Blog posts */}
      <div className="posts-grid">
        {filteredPosts.map((post) => (
          <div key={post.id} className="post-card">
            <img src={post.image} alt={post.title} />
            <span className="category">{post.category}</span>
            <h3>{post.title}</h3>
            <p>{post.excerpt}</p>
            <div className="meta">
              <User size={14} /> {post.author} • {post.readTime}
            </div>
            <button onClick={() => setSelectedPost(post)}>
              Read More <ArrowRight size={14} />
            </button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Blog;
